BIRT does no crosstabulation (yet), as far as I know. So I found a generic stored procedure for MySQL 5.0 to generate a crosstab. It works fine in MySQL (MySQL QueryBrowser 1.1.20). When I call this procedure from BIRT, BIRT displays garbage in the table cells in the data set definition preview view ('Edit Data Set') as well as in the tables in the report. It looks like as if the data of the return record were not well parsed. Several columns are displayed in the first cell of the first row. No error is shown.

Callipso release BIRT 2.1.0.N20060628-1351, MySQL - 5.0.21-community-nt, jdbc connection with JConnector 3.1.11 (or JConnector 5.0.0-beta: the same), a locally installed Apache/2.2.2 (Win32) server on WinXP. The same behaviour happened already with Eclipse 3.1 and BIRT 2.0.



1) This is the stored procedure in a schema called 'test': the procedure generates only one result set.

DELIMITER $$

DROP PROCEDURE IF EXISTS `test`.`sp_crosstab` $$
CREATE PROCEDURE `sp_crosstab`(table_name VARCHAR(255), row_field VARCHAR(255), col_field VARCHAR(255), val_field VARCHAR(255), filter VARCHAR(255), agg_func VARCHAR(255))

   DETERMINISTIC
   SQL SECURITY INVOKER
   COMMENT 'Generate dynamic crosstabs'
   COMMENT 'source: Kiran Modha at http://www.futhark.ch/mysql/106.html'

begin

   declare sql_query varchar(4096);
   declare temp_table_sql varchar(4096);
   declare colval varchar(32);
   declare newcol varchar(32);
   declare newline char(1);
   declare done bit(1);
   declare return_table_query varchar(4096);
   declare FldCursor Cursor for select temp_col from xtab_table;
   declare continue handler for not found set done=1;

   set @newline := char(10);

   drop table if exists xtab_table;
   set @temp_table_sql := concat('create temporary table xtab_table ',
                                ' select distinct ',
                                col_field ,
                                ' as temp_col from ' ,
                                table_name  );

   if NOT(isnull(filter) OR filter="")
   then  set @temp_table_sql := concat(@temp_table_sql, ' WHERE ',filter);
   end if ;

   prepare column_query from @temp_table_sql;
   execute column_query;
   deallocate prepare column_query;

   set @sql_query := concat('select ', row_field);

   open FldCursor;
   column_loop: LOOP
        fetch FldCursor into colval;
        if done then leave column_loop; end if;
        set @newcol := concat(' , \n ',
                            agg_func ,
                            '(case ' ,
                            col_field ,
                            ' when ''' ,
                            colval,
                            ''' then   ' ,
                            val_field ,  ' else NULL end) as ''' , colval ,''' '
                            );

        set @sql_query = concat(@sql_query, @newcol);
   end loop column_loop;
   close FldCursor;

   set @sql_query = concat(@sql_query, ' from ' , table_name  );

   if NOT(isnull(filter) OR filter="")
   then  set @sql_query := concat(@sql_query, ' WHERE ',filter);
   end if ;

   set @sql_query = concat(@sql_query, ' group by ' , row_field  );

   prepare return_query from @sql_query;
   execute return_query;
   deallocate prepare return_query;

end $$

DELIMITER ;



